import './App.css';
import {Note} from "./Note.js";

export default function App({notes = []}) {
  return (
    <div>
      <h1>Notes</h1>
      <ol>
        {notes.map((note)=>(
          <Note key={note.id} {...note} />
        ))}
      </ol>
    </div>
  )
}
